import React, { Component, useRef } from "react";
import 'twitch-stream-embed';
import './App.css';


class TwitchView extends Component {
	constructor(props) {
    super(props);

    this.state = {
      muted: props.muted
    };

  }

	render() {
  	return (
  	  <div>
				<twitch-stream channel="ampm_m" muted={this.state.muted}>{this.state.muted}</twitch-stream>;
  	  </div>
  	);
	}
}

export default TwitchView;
